import React from 'react';
function Dinner(props) {
  return (
    <div>
      <h1>Today we are serving {props.dishName}</h1>
      <h1>Today we are also serving sweet dish {props.sweetDish}</h1>
      <h1>my age is {props.myage}</h1>
    </div>
  );
}
export default Dinner;
